description:
Il corso **Communitas – Collaborazione Intelligente** fornisce strumenti pratici per:  
- migliorare la comunicazione interna ed esterna dei team;  
- gestire progetti e attività con trasparenza e chiarezza;  
- utilizzare **Obsidian come collaboration hub** per progetti, riunioni e task;  
- integrare strumenti esterni (Teams, Slack, calendari) solo dove indispensabile;  
- sviluppare un *Playbook Collaborativo* che garantisca governance e continuità operativa.
